msItem.note:
Added by various 15th-century hands; the recipes are all in Middle English, but there is one line from a cure
                                    for reuma that is also found in the Regimen Sanitatis Salernitanum: 'Esuries, scicies, vigeles [sic: 'vigiles']:
                                    sic creumata [sic: 'reumata'] cures'
